		<script type="text/javascript">
			$(window).load(function() {
				document.getElementById("sfkyjx").innerText = "您在有效预约时间内，可以进校~";
				if ("0" != "0") {
					$("#viewConttainer1").attr("src", "/fkjxm/Img/err.jpg");
					document.getElementById("sfkyjx").innerText = "您当前申请失效，暂不可进校";
				} else {
					if ("1" != "1") {
						$("#viewConttainer1").attr("src", "/fkjxm/Img/err.jpg");
						document.getElementById("sfkyjx").innerText = "当前时间不在有效预约时间，暂不可进校";
					} else {
						if ("1" != "1") {
							$("#viewConttainer1").attr("src", "/fkjxm/Img/err.jpg");
							if ("1" == "3") {
								document.getElementById("sfkyjx").innerText = "您的浙江健康码获取失败，暂不可进校";
							} else if ("1" == "4") {
								document.getElementById("sfkyjx").innerText = "暂未获取到您的浙江健康码，暂不可进校";
							} else if ("1" == "2") {
								document.getElementById("sfkyjx").innerText = "您的浙江健康码非绿码，暂不可进校";
							}
						}
						if ("" == "2") { //代表核酸过期
							document.getElementById("sfkyjx").innerText = "您的核酸检测结果过期，请尽快前往核酸采样点采样。";
						} else if ("" == "9") {
							document.getElementById("sfkyjx").innerText = "核酸结果获取失败，请重试！";
						}
					}
				}
				//获取当前时间
				var date = new Date();
				getDate();
				document.getElementById("yr").innerHTML = date.getMonth() + 1 + "月" + date.getDate() + "日";
				//使用定时器每秒向div写入当前时间
				setInterval(() => {
					getDate();
				}, 1000);

				//// 定时刷新页面
				setTimeout(() => {
					location.reload();
				}, 1000 * 60)
			});
			//得到时间并写入div
			function getDate() {
				//获取当前时间
				var date = new Date();
				//格式化为本地时间格式
				var hour = date.getHours() < 10 ? "0" + date.getHours() : date.getHours();
				var minute = date.getMinutes() < 10 ? "0" + date.getMinutes() : date.getMinutes();
				var second = date.getSeconds() < 10 ? "0" + date.getSeconds() : date.getSeconds();
				var date1 = hour + ":" + minute + ":" + second;
				//获取div
				var div1 = document.getElementById("times");
				//先清空span
				div1.innerHTML = "";
				//将时间写入div
				div1.innerHTML = date1;
			}
		</script>
